import React, { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { toast } from 'react-toastify';
import { registerApi } from '../apis/Api';
import '../css/regstyle.css';

const Register = () => {
  const [firstName, setFirstName] = useState('');
  const [lastName, setLastName] = useState('');
  const [username, setUserName] = useState('');
  const [email, setEmail] = useState('');
  const [phone, setPhone] = useState('');
  const [password, setPassword] = useState('');
  const [confirmPassword, setConfirmPassword] = useState('');
  const navigate = useNavigate();

  const changeFirstName = e => setFirstName(e.target.value);
  const changeLastName = e => setLastName(e.target.value);
  const changeUserName = e => setUserName(e.target.value);
  const changeEmail = e => setEmail(e.target.value);
  const changePassword = e => setPassword(e.target.value);
  const changeConfirmPassword = e => setConfirmPassword(e.target.value);

  const validateFirstName = name => /^[A-Za-z\s]+$/.test(name);
  const validateLastName = name => /^[A-Za-z\s]+$/.test(name);
  const validateUsername = username => /^[A-Za-z0-9]+$/.test(username);
  const validateEmail = email => /^[^\s@]+@[^\s@]+\.[^\s@]+$/.test(email);
  const validatePassword = password => password.length >= 8 && /\d/.test(password) && /[A-Za-z]/.test(password);

  const handleSubmit = e => {
    e.preventDefault();

    if (!validateFirstName(firstName)) {
      toast.error("First name must contain only letters and spaces");
      return;
    }

    if (!validateLastName(lastName)) {
      toast.error("Last name must contain only letters and spaces");
      return;
    }

    if (!validateUsername(username)) {
      toast.error("Username must be alphanumeric and contain no spaces");
      return;
    }

    if (!validateEmail(email)) {
      toast.error("Invalid email format");
      return;
    }

    if (!validatePassword(password)) {
      toast.error("Password must be at least 8 characters long and contain both letters and numbers");
      return;
    }

    if (password !== confirmPassword) {
      toast.error("Passwords do not match");
      return;
    }

    const data = {
      firstName: firstName,
      lastName: lastName,
      username: username,
      email: email,
      phone: phone,
      password: password,
    };

    registerApi(data)
      .then(res => {
        if (res.data.success === true) {
          toast.success(res.data.message);
          navigate('/login');
        } else {
          toast.error(res.data.message);
        }
      })
      .catch(err => {
        console.log(err);
        toast.error('Internal Server Error');
      });
  };

  return (
    <div className="register-background">
      <div className="form-container">
        <h1>Register Now</h1>
        <p>Register now to start your journey</p>

        <div className="input-group">
          <label htmlFor="firstName">First Name</label>
          <input
            type="text"
            id="firstName"
            name="firstName"
            value={firstName}
            onChange={changeFirstName}
            placeholder="First Name"
            required
          />
        </div>
        <div className="input-group">
          <label htmlFor="lastName">Last Name</label>
          <input
            type="text"
            id="lastName"
            name="lastName"
            value={lastName}
            onChange={changeLastName}
            placeholder="Last Name"
            required
          />
        </div>
        <div className="input-group">
          <label htmlFor="username">Username</label>
          <input
            type="text"
            id="username"
            name="username"
            value={username.toLowerCase().replace(/ /g, "")}
            onChange={changeUserName}
            placeholder="Username"
            required
          />
        </div>
        <div className="input-group">
          <label htmlFor="email">Email</label>
          <input
            type="text"
            id="email"
            name="email"
            value={email.toLowerCase().replace(/ /g, "")}
            onChange={changeEmail}
            placeholder="Email"
            required
          />
        </div>
        <div className="input-group">
          <label htmlFor="phone">Phone</label>
          <input
            type="text"
            id="phone"
            name="phone"
            value={phone.replace(/ /g, "")}
            onChange={changePhone}
            placeholder="Phone"
            required
          />
        </div>
        <div className="input-group">
          <label htmlFor="password">Password</label>
          <input
            type="password"
            id="password"
            name="password"
            value={password}
            onChange={changePassword}
            placeholder="Enter your password"
            required
          />
        </div>
        <div className="input-group">
          <label htmlFor="confirm-password">Confirm Password</label>
          <input
            type="password"
            id="confirm-password"
            name="confirmPassword"
            value={confirmPassword}
            onChange={changeConfirmPassword}
            placeholder="Confirm Password"
            required
          />
        </div>
        <button type="submit" onClick={handleSubmit}>Sign Up</button>
        <p>Already have an account? <Link to="/login">Sign In</Link></p>
      </div>
    </div>
  );
};

export default Register;
